import { Layout } from 'antd';
import NavBar from '../../Components/Navbar';
import Title from 'antd/lib/skeleton/Title';
const { Header, Footer, Sider, Content } = Layout;


const HomePage: FC = () => (
  <div >
 <Layout style={{background:'#E5E5E5'}} >
      <Header   style={{background:'#E5E5E5',padding:'20px'}}  >
      nghị lê
          {/* <NavBar></NavBar> */}
      </Header>
      <Layout>
        <Sider  style={{background:'#E5E5E5'}} >Sider</Sider>
      <Layout>
          <Content style={{background:'#FFFFFF'}} >content</Content>
          
      <Footer style={{background:'#E5E5E5'}}  >Footer</Footer>
      </Layout>
      </Layout>

    </Layout>
  </div>
);

export default HomePage;
